import { LossActionRow } from './LossActionRow';
import {  TableBody } from '@material-ui/core';
import {LossActionLevelTwo } from './LossActionLevelTwo'

export function LossActionLevelOne({data, columnProps, isOpen, onClick}){

      return (

          <TableBody data-testid="claims-list" className="level1">
            <LossActionRow
              columnProps={columnProps}
              data={data}
              padding={0}
              color="violet"
              onClick={onClick}
            />
            <LossActionLevelTwo
              data={data}
              columnProps={columnProps}
              isOpen={isOpen}
              setIsOpen={()=> {}}
             />
          </TableBody>
  
      );


}
